import React from "react";
import './card-list.styles.css';

export const CardList = props =>(
   
    <div className='card-list'>{props.dermatologists.map((dermatologist)=>(
            <h1>{dermatologist.EntityDTO.name}</h1>
            ))}
    </div>
);
